import React from 'react'
import RightElementShape from './RightElementShape'
import RightElementFace from './RightElementFace'
import RightElementHair from './RightElementHair'
import RightElementAccessories from './RightElementAccessories'
var createReactClass = require('create-react-class');

let BlockRight = createReactClass({
    getDefaultProps() {
        return {
            data: [
                { class: 'element_1', id: 'element_1' },
                { class: 'element_2', id: 'element_2' },
                { class: 'element_3', id: 'element_3' },
                { class: 'element_4', id: 'element_4' },
                { class: 'element_5', id: 'element_5' },
                { class: 'element_6', id: 'element_6' },
                { class: 'element_7', id: 'element_7' },
                { class: 'element_8', id: 'element_8' },
                { class: 'element_9', id: 'element_9' },
                { class: 'element_10', id: 'element_10' },
                { class: 'element_11', id: 'element_11' },
                { class: 'element_12', id: 'element_12' },
                { class: 'element_13', id: 'element_13' },
                { class: 'element_14', id: 'element_14' },
                { class: 'element_15', id: 'element_15' },
                { class: 'element_16', id: 'element_16' },
                { class: 'element_17', id: 'element_17' },
                { class: 'element_18', id: 'element_18' },
                { class: 'element_19', id: 'element_19' },
                { class: 'element_20', id: 'element_20' },
                { class: 'element_21', id: 'element_21' },
                { class: 'element_22', id: 'element_22' },
                { class: 'element_23', id: 'element_23' },
                { class: 'element_24', id: 'element_24' },
                { class: 'element_25', id: 'element_25' }
            ]
        }
    },

    getInitialState() {
        return {
        current: 0
        }
    },

    handleClick(i) {
        this.setState({
            current: i
        });
    },

    render() {
        var list = this.props.data.map(function(d, i) {
            return <li className={'left_option' + (i === this.state.current ? ' active' : '')} key={'left_option'+i} onClick={this.handleClick.bind(this, i)}>{d.title}</li>  
        }.bind(this));

        return (
            <div className="mood_block-right">
                <div className="right_elements">
                    <ul className="left_options">{list}</ul>
                    {this.props.data[this.state.current].id}
                </div>
            </div>    
        );
    }
});
